import { Container, Typography } from '@mui/material';

const Offers = () => {
  return (
    <Container>
      <Typography variant="h4" mb={2}>Pending/Accepted Offers</Typography>
      {/* Display offers content here */}
    </Container>
  );
};

export default Offers;
